import React from 'react';
import './FaceRecognition.css';

const FaceRecognition = ({ imageUrl , box }) => {
  return (
    <div className='center ma2' style={{ position: 'relative', zIndex: 1 }}>
      <img id='inputimage' style={{ height: '350px', width: '650px' }} alt='FaceRecognition' src={imageUrl} />
      <div className='bounding-box' 
      		style={{ top: box.topRow, 
      		left: box.leftCol , 
      		right: 650 - box.rightCol,
      		bottom: 350 - box.bottomRow,
      		height: box.bottomRow - box.topRow,
      		width: box.rightCol - box.leftCol

      	}}></div>
    </div>
  );
};

export default FaceRecognition;
